(12, 'STOLIK KAWOWY KAW01 4880 - ORZECH', 'Stolik kawowy idealny do każdego salonu', '<div>Zdjęcia przedstawiają mebel wykonany z płyty o kolorze <b>R4880 / R30018 Orzech Macchiato.</b> W zamówieniu prosimy o wskazanie zamawianego koloru</div>\r\n<div><h1>STOLIK KAWOWY</h1></div>\r\n<div><b>Indeks:</b> KAW01</div>\r\n<div><b>Szerokość:</b> 90cm</div>\r\n<div><b>Głębokość:</b> 60cm</div>\r\n<div><b>Wysokość:</b> 55cm</div>\r\n<div><b>Grubość płyty:</b> 18mm</div>\r\n<div><b>Obrzeże:</b> 2mm - grube obrzeże zapewniające większą trwałość</div>\r\n<div><b>Montaż:</b> Samodzielny z 6 elementów (4x noga, 1 blat środkowy, 1 blat górny) - instrukcja i wszystkie potrzebne rzeczy do montażu w komplecie.</div>\r\n<div><b>Kolorystyka:</b></div>\r\n<ul>\r\n<li>R4880 / R30018 - Orzech Macchiato</li>\r\n<li>R3082 / R48026 - Legno Jasne</li>\r\n<li>R5113 / R24048 - Buk Bawaria</li>\r\n<li>R3071 / R45000 - Śliwa Wallis (wydłużony czas dostawy do 7 dni)</li>\r\n<li>R3108 / R50031 - Oliwka Ciemna</li>\r\n<li>R3903 / R30062 - Real Walnut Brown</li>\r\n</ul>\r\n<div><b>UWAGA:</b> Wybarwienie kolorów może różnić się od rzeczywistego ze względu na różnice wynikające z budowy i ustawień wyświetlaczy.</div><br>\r\n<div>\r\nDo produkcji stolika użyto płyty podwójnie laminowanej (producent Pfleiderer) w grubości 18mm co zapewnia trwałość konstrukcji, którą dodatkowo wzmocniliśmy listwami między nogami a blatem co zwiększyło stabilność całego mebla. Ponadto do oklejenia krawędzi płyty zastosowano obrzeże PCV o grubości 2mm (konkurencja używa 0.8mm) aby produkt był odporniejszy na wszelkie uderzenia o twarde rzeczy.</div>\r\n<div>Stolik idealnie nadaje się do salonu. Jego prostota pozwala wpasować się do niemal każdego mieszkania. Wysokość mebla została dobrana tak aby wygodnie rozsiąść się na kanapie i w zaciszu rozkoszować się kawą lub herbatą.</div><br>\r\n<div><b>Użytkowanie:</b> Sugerujemy używanie miękkich materiałów do usuwania zanieczyszczeń.</div>\r\n<div><b>UWAGA:</b> do czyszczenia mebla nie zaleca się używania silnych środków czyszczących.</div>', 104.88, 129, ';1;3;', ':/kaw01/kaw01_4880', 1, 0, 'KAW01', 900, 600, 550, 4880);

